from stores.WO.Wo_model import WoStorefrom stores.WO.wo_info import wacom_page_urls, WO_WACOM_ARTICLES, xp_pen_page_urls, WO_XP_PEN_ARTICLESdef start_wo_wacom():    wo = WoStore(wacom_page_urls)    items = wo.generate_info()    return wo.compare_all_data(partner_list=items, articles_list=WO_WACOM_ARTICLES)def start_wo_xp_pen():    wo = WoStore(xp_pen_page_urls)    items = wo.generate_info()    return wo.compare_all_data(partner_list=items, articles_list=WO_XP_PEN_ARTICLES)